import React, { useReducer, useState } from "react"
import { JokeWrapper, NewJokeButton, PlaceholderContainer } from "./Placeholder.styles"
import { eel } from "../../eel"

const jokeReducer = (state:string, action:number)=> {
    const arr:string[] = [""]

    const setNewJoke = (newJokeArg:string,arr:string[]) =>{
        arr[0] = newJokeArg
    }

    eel.getJoke(action)((result)=>setNewJoke(result, arr))
    console.log(arr[0])
    return arr[0]
}

export const Placeholder = () => {

    const [joke, setJoke] = useReducer(jokeReducer,"")

    const handleNewJoke = ()=>{
       setJoke(Math.floor(Math.random()*100))
       console.log(joke)
    }


    return <PlaceholderContainer>
        <JokeWrapper>{joke}</JokeWrapper>
        <NewJokeButton onClick={handleNewJoke}>Get new joke</NewJokeButton>
    </PlaceholderContainer>




}
